import React from 'react'
import PropTypes from "prop-types"
import FilterButton from "./filter-button"

const Filter = ({ category, handleCategoryChange }) => {
  return (
    <>
      <div className="container">
        <FilterButton title="Develop Code" />
        <FilterButton title="Enable Experiences" />
        <FilterButton title="Build Brands" />
        <FilterButton title="Design Products" />
        <FilterButton title="Create Art" />
        <FilterButton title="Cook Food" />
        <FilterButton title="Write Articles" />
        <FilterButton title="Make Music" />
      </div>
      <style jsx>
        {`
          .container {
            width: 100%;
            display: flex;
            overflow: auto;
            flex-wrap: wrap;
            max-width: 800px;
            align-items: center;
            padding-top: 10px;
            border-width: 0;
            padding-left: 20px;
            padding-right: 20px;
            flex-direction: row;
            justify-content: flex-start;
            border-bottom-width: 0;
          }
        `}
      </style>
    </>
  )
}

Filter.propTypes = {
  category: PropTypes.string,
  handleCategoryChange: PropTypes.func
}

export default Filter
